import React from "react";

function Favorite() {
  return (
    <div >
      <h1 className="account-heading">Favorite</h1>
      <div className="favorites-cart">
      <i className="fas fa-heart favorites-cart-img"></i>
      <h1>Nothing In Here!</h1>
      <p>Have a Look around and items My favorite</p>
      <button>Sign In</button>
      </div>
    </div>
  );
}

export default Favorite;
